import React from 'react';
import Typography from '@material-ui/core/Typography';
import Home from '@material-ui/icons/Home';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/icons/List';
import BeachAccess from '@material-ui/icons/BeachAccess';
import { makeStyles } from '@material-ui/core/styles';
import Person from '@material-ui/icons/Person';
import { Button } from '@material-ui/core';
import Box from '@material-ui/core/Box';
import AttachMoney from '@material-ui/icons/AttachMoney';
import green from '@material-ui/core/colors/green';
import Select from '@material-ui/core/Select';
import Link from '@material-ui/core/Link';
import blue from '@material-ui/core/colors/blue';
import red from '@material-ui/core/colors/red';
import purple from '@material-ui/core/colors/purple';
import BrightnessLow from '@material-ui/icons/BrightnessLow';
import { IconButton } from '@material-ui/core';
import { lightBlue } from '@material-ui/core/colors';
import { MenuItem } from "@material-ui/core";
import { useState, useEffect } from "react";
import moment from 'moment';
import { useDispatch } from 'react-redux';
import { fetchUsers } from '../slice/holidaySlice';

const useStyles = makeStyles(theme => ({
  imageIcon: {
    width: 170,
    marginright: 'auto',
  },
  icon: {
    marginRight: theme.spacing(1)
  },
  Tool: {
    marginLeft: theme.spacing(40),
    paddingLeft: '14%'
  },
  underline: {
    borderBottom: "0px",
    "&:hover": {
      borderBottom: "0px ",
    },
    root: {
      paddingRight: theme.spacing(1)
    }
  }
}))
const dropdownStyles = makeStyles({
  underline: {
    borderBottom: "0px ",
    "&:hover": {
      borderBottom: "0px "
    },
  }
});

const NavBar = () => {
  const classes = useStyles();
  const currentYear = moment().format('YYYY');
  const today = parseInt(currentYear);
  const dropdown = dropdownStyles();
  const [item, setItem] = useState();

  const handleChange = (event) => {
    setItem(event.target.value);
  };

  const dispatch = useDispatch()
  useEffect(() => {
    dispatch(fetchUsers(today))
  },[today])
  return (
    <Box component="div">
      <Toolbar className={classes.icon}>
        <Link>
          <img className={classes.imageIcon} src="./blue.svg" alt='quadyster' />
        </Link>
        <Link>
          <IconButton>
            <Home style={{ color: blue[500]}} className={classes.icon} />
            <Typography variant="h6" >ClockTime</Typography>
          </IconButton>
        </Link>
        <Link>
          <IconButton>
            <List style={{ color: green[500] }} className={classes.icon}  />
            <Typography variant="h6" >TimeLog</Typography>
          </IconButton>
        </Link>
        <Link href="/" >
          <IconButton>
            <BeachAccess style={{ color: red[500] }}  className={classes.icon} />
            <Typography variant="h6"  >Holiday</Typography>
          </IconButton>
        </Link>
        <Link>
          <IconButton>
            <AttachMoney style={{ color: red[500] }}  className={classes.icon} />
            <Typography variant="h6" >Time Summary</Typography>
          </IconButton>
        </Link>
        <Link>
          <IconButton>
            <BrightnessLow style={{ color: lightBlue[500] }} className={classes.icon} />
            <Typography variant="h6"  >Settings</Typography>
          </IconButton>
        </Link>

        <Button aria-controls="simple-menu" aria-haspopup="true" >
          <Person style={{ color: purple[500] }} className={classes.Tool} />
        </Button>
        <Select
          className={dropdown.underline}
          value=""
          onChange={handleChange}
          disableUnderline
        >
          <MenuItem value={1}>Item 1</MenuItem>
          <MenuItem value={2}>Item 2</MenuItem>
          <MenuItem value={3}>Item 3</MenuItem>
        </Select>

      </Toolbar>

    </Box>
  )
}
export default NavBar;
